import React from 'react';
import "../App.css";
import BillView from '../components/BillView';
import background from '../components/background.jpg';

class Bill extends  React.Component{
      render()
    {
        return(
            <div style={mainStyle}>
                   <BillView/>
                </div>

        );
    }
}

const mainStyle={
    position:'fixed',
    backgroundImage:`url(${background})`,
    width:"1390px",
    borderTopStyle:'none',
    border: '3px solid Black',
    height:"900px",
    top:'140px'
};

export default Bill;
